import React from 'react';
import { motion, AnimatePresence } from 'framer-motion';

function App() {
  const [showSidebar, setShowSidebar] = React.useState(false);
  const [activeDropdown, setActiveDropdown] = React.useState(null);

  const toggleDropdown = (name) => {
    if (activeDropdown === name) {
      setActiveDropdown(null);
    } else {
      setActiveDropdown(name);
    }
  };

  const smoothScroll = (id) => {
    document.getElementById(id).scrollIntoView({ behavior: 'smooth' });
    setShowSidebar(false);
  };

  const sidebarVariants = {
    open: { x: 0 },
    closed: { x: "-100%" }
  };

  return (
    <div className="min-h-screen bg-gray-900 text-gray-300 font-sans relative">

      <button onClick={() => setShowSidebar(!showSidebar)} className="z-20 p-4 fixed top-0 left-0">Toggle Menu</button>

      <AnimatePresence>
        {showSidebar && (
          <motion.aside
            className="fixed top-0 left-0 h-full w-64 bg-black p-4 overflow-y-auto z-10"
            variants={sidebarVariants}
            initial="closed"
            animate="open"
            exit="closed"
          >
            <h1 className="text-3xl font-bold mb-4">AIAIC</h1>
            <button onClick={() => toggleDropdown('sections')} className="w-full text-left focus:outline-none">
              Sections
            </button>

            {activeDropdown === 'sections' && (
              <ul className="ml-4">
                <li><a role="button" onClick={() => smoothScroll('intro-section')} className="cursor-pointer hover:text-blue-400 focus:outline-none">Intro</a></li>
                <li><a role="button" onClick={() => smoothScroll('vision-section')} className="cursor-pointer hover:text-blue-400 focus:outline-none">Vision</a></li>
                <li><a role="button" onClick={() => smoothScroll('members-section')} className="cursor-pointer hover:text-blue-400 focus:outline-none">Members</a></li>
                <li><a role="button" onClick={() => smoothScroll('contact-section')} className="cursor-pointer hover:text-blue-400 focus:outline-none">Contact</a></li>
              </ul>
            )}
          </motion.aside>
        )}
      </AnimatePresence>

      <motion.section className="mt-16 bg-black text-white py-32" initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
        <div className="container mx-auto text-center">
          <motion.h2 className="text-6xl font-bold mb-8">Welcome to AIAIC</motion.h2>
          <motion.p className="text-2xl mb-12 mx-auto w-2/3">Your leading authority in artificial intelligence innovations</motion.p>
          <motion.a href="#!" whileHover={{ scale: 1.05 }} className="bg-blue-500 text-white py-2 px-8 rounded-full hover:bg-blue-600 transition duration-300">Learn More</motion.a>
        </div>
      </motion.section>

      <main className="py-10 px-5">
        <motion.section id="intro-section" className="my-24">
          <h2 className="text-4xl font-bold mb-10">AI Council - Intro</h2>
          <p className="text-xl text-gray-400 leading-relaxed mx-auto w-2/3">
            Founded in 2022, the All India Artificial Intelligence Council (AIAIC) was established with the goal of bringing together experts, researchers, and enthusiasts in the field of AI. As a premier organization, AIAIC serves as a platform for the exchange of knowledge, fostering collaborations, and setting standards in AI research and applications across India.
          </p>
        </motion.section>

        <motion.section id="vision-section" className="my-24">
          <h2 className="text-4xl font-bold mb-10">Our Vision</h2>
          <p className="text-xl text-gray-400 leading-relaxed mx-auto w-2/3">
            We envision a future where AI-driven technologies seamlessly integrate into every aspect of our lives, enhancing our day-to-day experiences, propelling businesses forward, and solving complex societal challenges. Through continuous education, research, and public-private partnerships, we aim to position India as a global leader in AI innovations and its ethical implementations.
          </p>
        </motion.section>

        <motion.section id="members-section" className="my-24">
          <motion.h2 className="text-4xl font-bold mb-10">Members of AI Council</motion.h2>
          <motion.ul className="text-xl text-gray-400 leading-relaxed mx-auto w-2/3 space-y-4">
            <li>Dr. Rajan Verma - Chair of AI Research</li>
            <li>Ms. Shreya Mehta - Chief AI Ethics Officer</li>
            <li>Mr. Arvind Joshi - Head of AI Innovations</li>
            <li>Dr. Priya Raghav - AI Healthcare Lead</li>
            <li>Mr. Rakesh Kumar - AI Technologies Director</li>
          </motion.ul>
        </motion.section>

        <motion.section id="contact-section" className="my-24">
          <motion.h2 className="text-4xl font-bold mb-10">Contact Us</motion.h2>
          <motion.p className="text-xl text-gray-400 leading-relaxed mx-auto w-2/3">
            Have questions or wish to collaborate with us? Reach out at <a href="mailto:contact@aiaic.org" className="underline">contact@aiaic.org</a> or visit our headquarters in New Delhi.
          </motion.p>
        </motion.section>
      </main>

      <footer className="bg-black text-white py-12">
        <div className="container mx-auto text-center">
          <p>&copy; 2023 All India Artificial Intelligence Council. All rights reserved.</p>
        </div>
      </footer>

    </div>
  );
}

export default App;
